import Header from './components/Header.js';
import Nav from './components/Nav.js';
import Aside from './components/aside.js';
import Article from './components/Article.js';
import './styles/main.css';
function App() {
  return (
    <div className="App">
      <BackgroundVideo />
      <Header />
      <Nav />
      <Aside />
    </div>
  );
}

export default App;
